// frontend/src/components/ForecastResult.js
import React from 'react';

function ForecastResult({ forecastData }) {
  if (!forecastData) {
    return (
      <div className="forecast-result">
        <h3>Forecast Details</h3>
        <p>No data available. Please enter location and click Submit.</p>
      </div>
    );
  }

  const {
    lat, lon,
    temperature,
    rainProbability,
    sunProbability,
    windSpeed,
    customization,
    forecastDate
  } = forecastData;

  return (
    <div className="forecast-result">
      <h3>Forecast Details</h3>
      <div className="forecast-details">
        <img
          src="https://th.bing.com/th/id/OIP.dwuAXVyZx5MTZsLoTojyUQHaHa?w=189&h=189&c=7&r=0&o=5&pid=1.7"
          alt="Weather Icon"
          className="weather-icon"
        />
        <div>
          <p>Latitude: {lat.toFixed(5)}, Longitude: {lon.toFixed(5)}</p>
          <p>Temperature: {temperature} Â°C</p>
          <p>Rain Probability: {rainProbability}%</p>
          <p>Sun Probability: {sunProbability}%</p>
          <p>Wind Speed: {windSpeed} km/h</p>
          {customization && <p>Customization: {customization}</p>}
          {forecastDate && <p>Specific Date: {forecastDate}</p>}
        </div>
      </div>

      {/* Example "clusters" or "alerts" sections could go here */}
      <div className="alert-section">
        <h3>Weather Alerts</h3>
        <div className="weather-alert">
          <p>No alerts at this moment (Random placeholder alert).</p>
        </div>
      </div>
    </div>
  );
}

export default ForecastResult;
